			 Acc, _, TrUserData) ->
    {NewFValue, RestF} = {id(X bsl N + Acc =/= 0,
			     TrUserData),
			  Rest},
    dfp_read_field_def_value(RestF, 0, 0,
			     id({bool_value, NewFValue}, TrUserData),
