			      TrUserData);
dfp_read_field_def_list_value(<<>>, 0, 0, R1,
			      TrUserData) ->
    S1 = #{},
    if R1 == '$undef' -> S1;
       true -> S1#{values => lists_reverse(R1, TrUserData)}
    end;
dfp_read_field_def_list_value(Other, Z1, Z2, F@_1,
			      TrUserData) ->
